<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Event Participation Ticket</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@400;700&display=swap');

        body {
            font-family: 'Roboto', sans-serif;
            margin: 0;
            padding: 0;
            background-color: #fff;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        .ticket {
            width: 300px;
            padding: 20px;
            background-color: #fff;
            border-radius: 10px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.1);
            text-align: center;
            position: relative;
            overflow: hidden;
        }

        .ticket:before {
            content: '';
            position: absolute;
            top: -10px;
            left: -10px;
            width: 0;
            height: 0;
            border-left: 20px solid transparent;
            border-right: 20px solid transparent;
            border-bottom: 20px solid #19bcff;
        }

        .ticket:after {
            content: '';
            position: absolute;
            bottom: -10px;
            right: -10px;
            width: 0;
            height: 0;
            border-left: 20px solid transparent;
            border-right: 20px solid transparent;
            border-top: 20px solid #19bcff;
        }

        .header {
            margin-bottom: 20px;
        }

        .header img {
            width: 100px; /* Adjust the width as needed */
            height: auto;
            margin-bottom: 10px;
        }

        .header h1 {
            font-size: 24px;
            color: #19bcff;
            margin: 0;
        }

        .event-info {
            margin-bottom: 20px;
            color: #333;
        }

        .event-info p {
            margin: 5px 0;
        }

        .ticket-details {
            margin-bottom: 20px;
            color: #333;
        }

        .ticket-details p {
            margin: 5px 0;
        }

        .ticket-footer {
            color: #888;
        }

        .ticket-footer p {
            margin: 5px 0;
        }
    </style>
</head>
